import styled from 'styled-components'
import Theme from '../../public/theme'
import Container from '../components/container'

const Card = () => {

    return (
        <Container justify="space-evenly">
            <Circle />
        </Container>
    )
}

const Circle = styled.div`
    height: 50px;
    width: 50px;
    background-color: ${Theme.colors.primary};
    border-radius: 100%;
`

export default Card
